import React, { useState } from "react";
import './CurdOpration.css'

const CurdOperationHome = () => {
    const [state, setState] = useState({
        userName: "",
        age: "",

        userNameError: "",
        ageError: "",

        UserData: [],
    });

    console.log("CURD", state);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setState(prevState => ({ ...prevState, [name]: value, userNameError: "", ageError: "" }));
    }

    const handleSubmit = () => {
        const { userName, age } = state;
        if (!userName) {
            setState(prevState => ({ ...prevState, userNameError: "Please Enter User Name" }));
            return;
        } else if (!age) {
            setState(prevState => ({ ...prevState, ageError: "Please Enter Age" }));
            return;
        }
        let newUser  = {
            "userName": userName,
            "age": age
        }
        setState(prevState => ({ ...prevState,UserData: [...prevState.UserData, newUser],userName:"",age:""}));
    }

    return (
        <div>
            <div className="card">
                <div className="card-body text-dark card_bg_Color">
                    <h4 className="text-center">Naresh</h4>
                </div>
            </div>


            <div class="row mt-2">
                <div class="col-lg-12">
                    <div class="card creation_Card">
                        <div class="card-body">
                            <div className="row col-lg-12">
                                <div>
                                    <h6>User Name : <span>{state.userNameError}</span></h6>
                                    <input type="text" name="userName" value={state.userName} className="form-control" onChange={handleChange} placeholder="Enter User Name" />
                                </div>
                                <div className="mt-2">
                                    <h6>Age : <span>{state.ageError}</span></h6>
                                    <input type="number" name="age" value={state.age} className="form-control" onChange={handleChange} placeholder="Enter Age" />
                                </div>
                                <div>
                                    <button className="btn btn-success mt-3" onClick={handleSubmit}>Submit</button>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>

            <div className="mt-3">
            <table class="table table-bordered">
  <thead>
    <tr>
      <th scope="col">#</th>
      <th scope="col">First</th>
      <th scope="col">Last</th>
      <th scope="col">Handle</th>
    </tr>
  </thead>
  <tbody>
    <tr>
      <th scope="row">1</th>
      <td>Mark</td>
      <td>Otto</td>
      <td>@mdo</td>
    </tr>
    <tr>
      <th scope="row">2</th>
      <td>Jacob</td>
      <td>Thornton</td>
      <td>@fat</td>
    </tr>
    <tr>
      <th scope="row">3</th>
      <td colspan="2">Larry the Bird</td>
      <td>@twitter</td>
    </tr>
  </tbody>
</table>
            </div>
        </div>
    )
}
export default CurdOperationHome;
